import React from 'react'
import usePages from '../data/usePages';

var pageNotNull = [];
const Header = () => {
    const pages = usePages();
    
    if (pages !== null) {
        pages.sort((a,b)=>a.itemM > b.itemM ? 1 : -1).map( item => (
          pageNotNull = item
        ))
        return (
          pageNotNull.map(item => (
            <h1 key={item.id}>{item.title}</h1>
          ))
        )
    }
}

export default Header
